import NavBar from "../../components/NavBar/NavBar";
import Header from "../../components/Header/Header";
import MiddleTop from "../../components/Middle/MiddleTop";
// import MiddleCenter from "../../homePage/middlecenter";
// import MiddleBottom from "../../homePage/middlebottom";
import Form from "../../homePage/form";
import Foot from "../../homePage/foot";
import "./home.css";
import React from "react";

const Home = () => {
  return (
    <React.Fragment>
      <div className="back"></div>
      <div className="home">
        <Navbar />
        <Header />
        <div className="container-flex">
          <MiddleTop />
          <h3 className="part2">Browse by property type</h3>
          {/* <MiddleCenter /> */}
          <h3 className="part2">Homes guests love</h3>
          {/* <MiddleBottom /> */}
        </div>
      </div>
      {/* <Form /> */}
      <div className="home">{/* <Foot /> */}</div>
    </React.Fragment>
  );
};

export default Home;
